import CircularProgressWithLabel from '@material-ui/core/CircularProgress';
import Typography from '@material-ui/core/Typography';



const Output = () => {

    var running = false;
    var finished = false;
    var progress = 45
    var probeF = 'ATGC'
    var probeQ = 'ATGC'
    var sink = 'ATGC'
    var sinkC = 'ATGC'

    if(running) {
        return (
            <div className="progress">
                <CircularProgressWithLabel variant="determinate" value={progress} className="progressbar"/>
                <Typography variant="caption" className="progresslabel" color='caption'>{`${Math.round(
                  progress,
                )}%`}</Typography>
            </div>
        );
    }
    else if (finished) {
        return (
            <div className="outputsequences">
                <div className="sequencelabels">
                    <p>ProbeF: </p>
                    <p>ProbeQ: </p>
                    <p>Sink: </p>
                    <p>Sink*: </p>
                </div>
                <div className="outsequences">
                    <p>{probeF}</p>
                    <p>{probeQ}</p>
                    <p>{sink}</p>
                    <p>{sinkC}</p>
                </div>
            </div>
        );
    }
    else {
        return (
            <div className="emptyoutput">
                <h3>Output</h3>
            </div>
        );
    }

};

export default Output;
